import { GetTaskType } from "../Type";


export const GettaskListReducer = (state = null , action) => {
    console.log(action.payload);
if (action.payload == undefined) {
    switch (action.type) {
        case GetTaskType:
          return action.payload;
        default:
          return state;
      }
}
    
  };
